import React from 'react';

const Tasks = ({ handleSidebarToggle }) => {
  return (
    <div>
      <h1>Tasks Page</h1>
      <button onClick={handleSidebarToggle}>Toggle Sidebar</button>
    </div>
  );
};

export default Tasks;
